import './App.css';
import Header from './components/Header/Header';
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import AboutUs from './components/AboutUs/AboutUs';
import Rent from './components/Rent/Rent';

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Switch>
        <Route path='/about-us'>
          <AboutUs />
        </Route>
        <Route path='/rent'>
          <Rent />
        </Route>
        <Route path='/del'>
          <AboutUs />
        </Route>
        <Route path='/about-us'>
          <AboutUs />
        </Route>
        <Route path='/about-us'>
          <AboutUs />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
